import React from 'react'
import axios from 'axios'
import data from './data/menu.json';

const App = () => {
  return (
    <div>
        <h1>My menu</h1>
        <div className="menu">
            {data.map((meal) => {
                return(
                    <div className="meal" key={meal.id}>
                        <h3>Name: {meal.name}</h3>
                        <p>Price: {meal.price}</p>
                    </div>
                );
            })}
        </div>
    </div>
  )
}

export default App
